          "title": "Davis vs Garcia HIGHLIGHTS: January 7, 2023 | PBC on Showtime PPV",
          "description": "Boxing superstar and five-time world champion Gervonta â€œTankâ€ Davis sent a sold out crowd in the nationâ€™s capital home happy with another memorable victory as he displayed his skills and then stopped featherweight champion Hector Luis Garcia in the ninth round Saturday night headlining live on SHOWTIME PPV from Capital One Arena in Washington, D.C. in an event presented by Premier Boxing Champions.\n \nThe Baltimore-native Davis delighted the 19,731 fans in attendance as he methodically broke down the previously unbeaten Garcia, before hurting him badly with his vaunted left hand late in the eighth round. Visibly shaken on his way back to the corner, Garcia stayed on his stool as the bell for round nine rang. Moments later, his trainer Bob Santos advised referee Albert Earl Brown to stop the fight, with the official stoppage coming 13 seconds into round nine.\n \nâ€œI was a little surprised he didnâ€™t come out,â€ said Davis. â€œBut I knew he was hurt bad but heâ€™s a fighter and he didnâ€™t want to show it. I knew he was hurt though.â€\n \nâ€œWhen I got the shot to my head in the final round, thatâ€™s when I couldnâ€™t see from my eye,â€ said Garcia, who owns the WBA Super Featherweight World Title. â€œI didnâ€™t know where I was when he hit me with that shot. My vision is back but my head still hurts. I couldnâ€™t see from my right eye. It was going well up until that point. I was picking my shots.â€\n \nThe two champions jockeyed for position over the first three rounds before Davis got the fans back on their feet with a series of hard power shots late in round four. Garcia displayed a solid straight left hand that he employed to counter the speed of Davisâ€™ jabs, and was the busier fighter according to CompuBox, throwing 345 punches to Davisâ€™ 239.\n \nHowever, it was Davisâ€™ effective and efficient attack, which built as the fight went on, that helped him take control of the fight. After landing only four power punches in the first three rounds, Davis connected on 69 in rounds four through eight.\n \nâ€œI wasnâ€™t throwing a lot of shots in the beginning because I was trying to beat him mentally,â€ said Davis. â€œI was trying to trick him with my hands and my eyes and things like that because heâ€™s a tough fighter. I had to bait him.â€\n \nThe victory was Davisâ€™ fifth successful defense of his WBA Lightweight Title, and one that the judges saw him in control of throughout, as he led 79-73 on two cards and 78-74 on the third. After the fight, Davis sent a message to his fellow unbeaten rival Ryan Garcia, as the two near a previously announced blockbuster clash this spring.\n \nâ€œGod willing Iâ€™m ready for the fight with Ryan Garcia,â€ said Davis. â€œItâ€™s scheduled for April. Iâ€™m here. Heâ€™s been training. Heâ€™s been talking. And letâ€™s see whoâ€™s really about that.â€\n \nIn the co-main event, rising welterweight star Jaron â€œBootsâ€ Ennis (30-0, 27 KOs) cruised to a unanimous decision over Karen Chukhadzhian (21-2, 11 KOs) to earn the vacant Interim IBF Welterweight Title after going 12 rounds for the first time by the score of 120-108 three times.\n \nâ€œI learned to just take my time and to not rush anything,â€ said Ennis. â€œIâ€™m glad I went 12 rounds. It felt great. I felt I was in the best shape. I just needed to throw a little more punches. I should have got him out of there.â€\n \n#DavisGarcia #GervontaDavis #HectorGarcia \n\nVisit PremierBoxingChampions.com for more info.\r\n\r\nSIGN UP FOR FIGHT ALERTS: \r\n\r\nhttps://pbcham.ps/FightAlerts\r\n\r\nFOLLOW US:\r\n\r\nhttps://twitter.com/premierboxing\r\nhttps://instagram.com/premierboxing\r\nhttps://www.facebook.com/premierboxingchampions"
